    false,nt"url": null,nt"notes": "This narrative report for Okefenokee National
    Wildlife Refuge summarizes Refuge activities from May through August of 1960.  The
    report begins with a summary of the weather and habitat conditions during the period.
     Wildlife- including migratory birds, upland game birds, big game animals, fur
    animals, predators, rodents, other mammals, and predacious birds- is also covered.
     The report includes a Refuge development and maintenance section which discusses
    physical developments and fires.  Resource management is outlined; topics include
    timber removal and concessions.  A progress report on field investigations and applied
    research is also provided.  The public relations section of the report discusses
    Refuge visitors and Refuge participation.  Items of interest, N-R forms, and photographs
    are provided at the end of the report.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
